import React from 'react';
import './gif-list.css';

export default function Giflist(props) {
    return (
        <div className="resultados">
          {props.gifs.map((gif) => {
            return (
                <img src={gif.images.fixed_width.url} alt={gif.title} />
            )
          })}
        </div>
    )
}
